DU Meter lets you see how much of your full bandwidth potential is actually utilized at any given point, either by displaying a real-time graph, numerical display, or both. It works with Dial-Up, DSL, DSL, Cable Modem, and Ethernet cards.  
DU Meter can be configured to fit neatly in the blank space on your browser toolbar and uses only a very small amount of Windows resources. DU Meter installation involves no changes to your Windows system files. DU Meter also includes full logging and reporting capabilities with export to many different file formats, including Excel and HTML. It also has an auto hide feature, monitoring of online hours with alerts, a fully customizable interface, and a great stopwatch which helps you to accurately time your downloads. 
Operating Systems:  Windows 2000, XP, 2003, Vista, 2008, Windows 7, Windows 8

